/* eslint-disable no-unused-vars */
/* eslint-disable prettier/prettier */
import { Button, Col, Row } from 'antd';
import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';

import { useDispatch, useSelector } from 'react-redux';
import AdvertisementTable from './AdvertisementTable';
import { PageHeader } from '../../components/page-headers/page-headers';
import { CardToolbox, Main } from '../styled';
import { AutoComplete } from '../../components/autoComplete/autoComplete';
import { getListAdvertisement } from '../../redux/advertisement/actionCreator';
import axios from 'axios';
import Cookies from 'js-cookie';



const ListAdvertisement = () => {
    const { listAdvertisement } = useSelector(state => state.Advertisement);

    const dispatch = useDispatch();

    useEffect(() => {
        dispatch(getListAdvertisement(1, 5));
    }, [dispatch]);


    return (
        <>
            <CardToolbox>
                <PageHeader
                    ghost
                    title="List Advertisement"
                    subTitle={
                        <>
                            <AutoComplete
                                listAdvertisement={listAdvertisement}
                                placeholder="Search by Name"
                                width="100%"
                                onSearch={value => {
                                    const res = axios.get(`https://api.develocity.finance/api/v1/admin/advertisementList?search=${value}`,
                                        {
                                            headers: {
                                                'Content-Type': 'application/json',
                                                'token': Cookies.get('token')
                                            }
                                        });
                                        console.log(res);
                                    }}
                                patterns

                            />
                        </>
                    }
                    buttons={[
                        <Button className="btn-add_new" size="default" type="primary" key="1">
                            <Link to="/admin/addAdvertisement">+ Add New Advertisement</Link>
                        </Button>
                    ]}
                />
            </CardToolbox>

            <Main>
                <Row gutter={15}>
                    <Col md={24}>
                        {listAdvertisement && listAdvertisement.length > 0 ? (
                            <AdvertisementTable data={listAdvertisement} />
                        ) : null}
                    </Col>
                </Row>
            </Main>
        </>
    );
};

export default ListAdvertisement;
